import React from 'react';

export const About = () => {
  return (
    <div>
      <h1>About the Contact Managemtn App</h1>
      <p className="my-1">
        This Contact Management APp is a full stack MERN App for keeping track
        of all your contact
      </p>

      <p className="bg-dark p">
        <strong>Version</strong>1.0
      </p>
    </div>
  );
};
